import React from 'react';
import styled from 'styled-components';

function Feature() {
    return(
        <FeatureSection>

            <BannerTeam>
                <BannerLetter>w</BannerLetter>
                <BannerLetter>a</BannerLetter>
                <BannerLetter>l</BannerLetter>
                <BannerLetter>l</BannerLetter>
                <BannerLetter>e</BannerLetter>
                <BannerLetter>t</BannerLetter>
            </BannerTeam>

            <FeatureContainer>
                <HeaderContainer className='row'>
                    <HeaderContent>ICO Wallet Feature</HeaderContent>
                    <Line/>
                </HeaderContainer>

                <BodyContainer>

                </BodyContainer>
            </FeatureContainer>

        </FeatureSection>
    );
}

const FeatureSection = styled.section`
    position: relative;
    padding: 10% 15px 0;
`

const BannerTeam = styled.div`
    position: absolute;
    top: -3%;
    left: 5%;
`

const BannerLetter = styled.span`
    font-size: 50px;
    z-index: -1;

    font-size: 250px;
    font-weight: 900;
    font-family: sans-serif;
    letter-spacing: 10px;
    line-height: normal;
`

const FeatureContainer= styled.div``

const HeaderContainer = styled.div``

const HeaderContent = styled.div`
    width: 100%;
    color: #fff;
    font-size: 40px;
    font-family: sans-serif;

    text-align: center;
    z-index: 1;
`
const Line = styled.div`
    width: 40px;
    height: 2px;
    background: #aceb2f;

    margin: auto;
    z-index: 1;
`

const BodyContainer = styled.div``  

export default Feature;
